    % - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - -
    %
    function out_h = h( this, in_1, in_2, t )
      % Calculate the residual of the invariants h.

      % Extract properties
      U__b = this.m_U__b;
      U__f = this.m_U__f;
      alpha = this.m_alpha;
      beta = this.m_beta;
      R__0 = this.m_R__0;
      R__1 = this.m_R__1;
      R__2 = this.m_R__2;
      R__3 = this.m_R__3;
      R__4 = this.m_R__4;
      R__5 = this.m_R__5;
      R__6 = this.m_R__6;
      R__7 = this.m_R__7;
      R__8 = this.m_R__8;
      R__9 = this.m_R__9;
      C__1 = this.m_C__1;
      C__2 = this.m_C__2;
      C__3 = this.m_C__3;
      C__4 = this.m_C__4;
      C__5 = this.m_C__5;

      % Extract inputs
      y__1 = in_1(1);
      y__2 = in_1(2);
      y__3 = in_1(3);
      y__4 = in_1(4);
      y__5 = in_1(5);
      y__6 = in_1(6);
      y__7 = in_1(7);
      y__8 = in_1(8);

      % Evaluate function
      t4 = R__0 * R__1;
      t6 = 0.1e1 / U__f;
      t8 = exp(t6 * (y__2 - y__3));
      t11 = R__2 * R__1;
      t14 = sin(200 * pi * t);
      out_1 = 0.1e1 / C__1 / R__1 / R__2 / R__0 * (t8 * t4 * (alpha - 0.1e1) * beta * R__2 - 0.1e0 * t14 * t11 + y__2 * (-0.1e1 * t4 - 0.1e1 * R__0 * R__2) - 0.1e1 * y__1 * t11 + ((-0.1e1 * alpha + 0.1e1) * beta * R__2 + U__b) * R__0 * R__1);
      t45 = exp(t6 * (y__5 - y__6));
      out_2 = 0.1e1 / C__3 / R__5 / R__6 / R__4 * (t45 * (alpha - 1) * beta * R__4 * R__5 * R__6 - R__6 * alpha * beta * R__5 * R__4 * t8 - R__4 * (R__6 + R__5) * y__5 - R__5 * (y__4 * R__6 + (-R__6 * beta - U__b) * R__4 - R__6 * U__b));
      out_3 = 0.1e1 / C__5 / R__9 / R__8 * (-R__9 * alpha * beta * R__8 * t45 - y__7 * R__9 - y__8 * R__8 + R__9 * (alpha * beta * R__8 + U__b));

      % Store outputs
      out_h = zeros(3, 1);
      out_h(1) = out_1;
      out_h(2) = out_2;
      out_h(3) = out_3;
    end % h
