    % - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - -
    %
    function out_Jh_x = Jh_x( this, in_1, in_2, t )
      % Calculate the Jacobian of h with respect to x.

      % Extract properties
      U__b = this.m_U__b;
      U__f = this.m_U__f;
      alpha = this.m_alpha;
      beta = this.m_beta;
      R__0 = this.m_R__0;
      R__1 = this.m_R__1;
      R__2 = this.m_R__2;
      R__3 = this.m_R__3;
      R__4 = this.m_R__4;
      R__5 = this.m_R__5;
      R__6 = this.m_R__6;
      R__7 = this.m_R__7;
      R__8 = this.m_R__8;
      R__9 = this.m_R__9;
      C__1 = this.m_C__1;
      C__2 = this.m_C__2;
      C__3 = this.m_C__3;
      C__4 = this.m_C__4;
      C__5 = this.m_C__5;

      % Extract inputs
      y__1 = in_1(1);
      y__2 = in_1(2);
      y__3 = in_1(3);
      y__4 = in_1(4);
      y__5 = in_1(5);
      y__6 = in_1(6);
      y__7 = in_1(7);
      y__8 = in_1(8);

      % Evaluate function
      t1 = 0.1e1 / R__0;
      t2 = 0.1e1 / C__1;
      out_1_1 = -0.1e1 * t2 * t1;
      t6 = (alpha - 0.1e1) * beta;
      t8 = R__0 * R__1;
      t9 = 0.1e1 / U__f;
      t12 = exp(t9 * (y__2 - y__3));
      t13 = t12 * t9;
      out_1_2 = 0.1e1 / R__2 / R__1 * t2 * t1 * (t13 * t8 * R__2 * t6 - 0.1e1 * t8 - 0.1e1 * R__0 * R__2);
      t25 = beta * alpha;
      t26 = 0.1e1 / C__3;
      t28 = t26 * t25 * t13;
      out_2_2 = -t28;
      out_1_3 = -t2 * t13 * t6;
      out_2_3 = t28;
      t31 = 0.1e1 / R__4;
      out_2_4 = -t26 * t31;
      t36 = beta * (alpha - 1);
      t39 = exp(t9 * (y__5 - y__6));
      t40 = t39 * t9;
      out_2_5 = 0.1e1 / R__6 / R__5 * t26 * t31 * (t40 * t36 * R__4 * R__5 * R__6 - R__4 * (R__6 + R__5));
      t51 = 0.1e1 / C__5;
      t53 = t51 * t25 * t40;
      out_3_5 = -t53;
      out_2_6 = -t26 * t40 * t36;
      out_3_6 = t53;
      out_3_7 = -t51 / R__8;
      out_3_8 = -0.1e1 / R__9 * t51;

      % Store outputs
      out_Jh_x = zeros(3, 8);
      out_Jh_x(1, 1) = out_1_1;
      out_Jh_x(1, 2) = out_1_2;
      out_Jh_x(2, 2) = out_2_2;
      out_Jh_x(1, 3) = out_1_3;
      out_Jh_x(2, 3) = out_2_3;
      out_Jh_x(2, 4) = out_2_4;
      out_Jh_x(2, 5) = out_2_5;
      out_Jh_x(3, 5) = out_3_5;
      out_Jh_x(2, 6) = out_2_6;
      out_Jh_x(3, 6) = out_3_6;
      out_Jh_x(3, 7) = out_3_7;
      out_Jh_x(3, 8) = out_3_8;
    end % Jh_x
